import React from 'react';
import PropTypes from 'prop-types';
import { Panel, ListItem, Group, Div, Avatar, PanelHeader } from '@vkontakte/vkui';


const Home = ({ share, id, go, fetchedUser, add1, balance  }) => (

	<Panel id={id}>
		<PanelHeader>SmartCoin</PanelHeader>
		{fetchedUser &&
		<Group>
			<ListItem
				before={fetchedUser.photo_200 ? <Avatar src={fetchedUser.photo_200}/> : null}
				description={fetchedUser.city && fetchedUser.city.title ? fetchedUser.city.title : ''}
			>
				{`${fetchedUser.first_name} ${fetchedUser.last_name}`}
			</ListItem>
		</Group>}
		<Group>

			<h2>{balance} SC</h2>
		</Group>
			<Div align="center" style={{ height: "315px"}}>
                <img className="clicked" src={require('./click.png')} onClick={add1} width={250} height={250} alt="ХУЙ"/>
            </Div>
	</Panel>
);

Home.propTypes = {
	id: PropTypes.string.isRequired,
	go: PropTypes.func.isRequired,
	share: PropTypes.func,
	fetchedUser: PropTypes.shape({
		photo_200: PropTypes.string,
		first_name: PropTypes.string,
		last_name: PropTypes.string,
		city: PropTypes.shape({
			title: PropTypes.string,
		}),
	}),
};

export default Home;
